import styled from 'styled-components';

const GoogleRecaptchaSection = styled.section`
    font-family: Raleway, sans-serif;
    margin: 0 auto;
    max-width: 1024px;
    padding: 30px;
    width: 100%;
`;

export { GoogleRecaptchaSection };
